import React from 'react'

const AdminPanel = () => {
  return (
    <>
    <div className="row m-5">
        <div className="col-md-6">
            <h3>Product Name </h3>
            <input type="text" name="name" />
        </div>
        <div className="col-md-6">

        </div>
    </div>
    </>
  )
}


export default AdminPanel;
